import React from "react";
import { useState } from "react";
import { Detail } from "../Detail";

export default function Productmanage() {
  const [array,setArray]=useState([])
  const [inputdata,setInputdata]=useState({name:'',mail:'',num:''})
  const [showPopup, setShowPopup] = useState(false);

  function data(e){
    setInputdata({...inputdata,[e.target.name]:e.target.value})
  }

  let {}=inputdata
   function addinputdata(){
     
   }


  const handleOpenPopup = () => {
    setShowPopup(true);
  };

  const handleClosePopup = () => {
    setShowPopup(false);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setArray([...array,{name,num,mail}])
    console.log(inputdata)
    // Add form submission logic here
    // For example, you can get form data using e.target.elements
    // and perform further actions like saving to a database
    console.log("Form submitted!");
  };
  // const [data, setData] = useState(Detail);
return (
  <>
  {showPopup && (
    <div className="overlay">
      <div className="popup">
        <h2>Adding New User </h2>
        <form onSubmit={handleSubmit}>
          {/* Your form elements go here */}
          <label htmlFor="name">Name:</label>
          <input type="text" id="name" name="name" required onchange={data} />
          <label htmlFor="email">Email:</label>
          <input type="email" id="email" name="email" required onchange={data}/>
          <label htmlFor="Address">Address:</label>
          <input type="text" id="Address" name="Address" required onchange={data}/>
          <label htmlFor="Contact">Contact</label>
          <input type="num" id="Contact" name="Contact" pattern="[0-9]*" required onchange={data}/>
          <button type="submit">Submit</button>
        </form>
        <button onClick={handleClosePopup}>Close</button>
      </div>
    </div>
  )}

  <div className='container py-2'>
    <div className='head' style={{display: "flex", justifyContent: "space-between",  alignItems: "center"}}>
      <h1 className='title'>Inventory</h1>
      <button className='btn btn-lg btn-danger' onClick={handleOpenPopup}>Add New Product</button>
    </div>
  <div className="row py-2">
  <div className="col-md-12">
  <table className="table table-bordered">
    <thead>
      <tr>
        <th scope="col" style={{ alignSelf: "center" }}>IMG</th>
        <th scope="col" style={{ alignSelf: "center" }}>Name</th>
        <th scope="col" style={{ alignSelf: "center" }}>Catogory</th>
        <th scope="col" style={{ alignSelf: "center" }}>PRICE</th>
        <th scope="col" style={{ alignSelf: "center" }}></th>
      </tr>
    </thead>
    <tbody >
  {data.map((element) => (
  <tr key="0">
  <td>
    <img
      src={element.imgurl}
      style={{ maxHeight: "120px"}}
      alt="Product"
    />
  </td>
  <td >
    {element.title.slice(0, 40)}
  </td>
  <td >
    {element.cat}
  </td>
  <td className='p-2'>
    <div >
      <span  style={{ verticalAlign: "middle", textAlign: "center" }}>{element.price}</span>
    </div>
  </td>
  <td style={{ verticalAlign: "middle", textAlign: "center" }}>
    <button>Remove</button>
  </td>
</tr>

  ))}
  </tbody>
  </table>
  </div>
  </div>
</div>
</>
)
}
